import { productsType } from "../types/Types";

export const filterProductsData = (products: productsType[]): any => {
  const filteredUsers: productsType[] = products.map((product: productsType): productsType => {
      return {
        id: product.id,
        description: product.description,
        image: product.image,
        price: product.price,
        title: product.title,
        count: 0,
      };
    }
  );

  return filteredUsers;
};
